T["Problem in specifying stratum in MartinStats module."]=
  "Problème pour spécifier la strate dans le module MartinStats.";
T["TwobyTwo Tables"]="Tableaux 2 par 2";
T["<p>Two by two tables are used to evaluate the association between a possible risk factor (&quot;Exposure&quot;) and an outcome (&quot;Disease&quot;). Counts summarizing the occurence of the four possible combinations of events in the study population are entered into the appropriate cells. The table can be rotated or flipped  so that either rows or columns represent Exposure, and the column headings (+) and (-) can be  in either order to match common textbooks of epidemiology. A single table or multiple strata can be entered. </p> <p>Statistics produced include the Fisher and mid-p exact tests, chi squares, odds ratio, maximum likelihood odds ratio estimate, risk/prevalence ratio (relative risk), risk difference, and etiologic fractions with confidence limits produced by several methods, with stratified analysis "]=
  "<p>Les tableaux 2 x 2 sont utilisés pour évaluer l’association entre le facteur de risque possible (&quot;Exposition&quot;) et un résultat (&quot;Maladie&quot;). Les comptages résumant l’occurrence des quatre combinaisons possibles d’événements dans une population d’étude sont entrés dans les cellules appropriées. Le tableau peut être tourné ou retourné de manière à ce que les lignes ou les colonnes représentent l’Exposition et les en-têtes de colonne (+) et (-) puissent être dans n’importe quel ordre pour correspondre aux manuels usuels d’épidémiologie. Un tableau simple ou multi-strates peut être entré. </p> <p>Les statistiques créées incluent les tests de Fisher et mid-p exact, chi-carré, rapport de cotes, l'estimation du maximum de vraisemblance du rapport de cotes, rapport risque/prévalence (risque relatif), différence de risque et fractions étiologiques avec limites de confiance produites par de nombreuses méthodes avec analyses stratifiées ";
T["Load Demo Data"]="Télécharger les données de démonstration";
T["<b>Statistics</b><br>Kevin M. Sullivan, Emory University<br>and Andrew G. Dean, EpiInformatics.com<br>based on code from Pezzullo<br>Exact and maximum likelihood statistics adapted from a Pascal program by David Martin.Thanks to Ray Simons for advice and testing.<br><b>Interface</b><br>Andrew G. Dean and Roger Mir<br>"]=
  "<b>Statistiques</b><br>Kevin M. Sullivan, Université d’Emory<br>et Andrew G. Dean, EpiInformatics.com<br>basées sur le code de John C. Pezzullo<br>Statistiques exactes et de maximum de vraisemblance adapté d’un programme en Pascal de David Martin. Merci à Ray Simons pour ses conseils et ses essais.<br><b>Interface</b><br>Andrew G. Dean et Roger Mir<br>";
