T["Dose Response: Chi Square for Linear Trend"]=
  "Dose-réponse : Test du Chi carré pour tendance linéaire";
T["Use this module to test for trend when there are more than two levels of exposure. In the example shown, the levels are midpoints of ranges of cigarettes smoked per day during the third month of pregnancy. Cases are infants with congenital malformations. <p>The test performed is the Extended Mantel Haenszel Chi Square for linear trend with a p-value for one degree of freedom. More than one stratum can be entered to remove confounding.</p> "]=
  "Utilisez ce module pour tester la tendance quand il y a plus de deux niveaux d'exposition. Dans l’exemple montré, les niveaux sont les points centraux des séries du nombre de cigarettes fumées par jour pendant le troisième mois de grossesse. Les cas sont des bébés avec des malformations congénitales. <p>Le test effectué est le test du chi carré étendu de Mantel Haenszel pour tendance linéaire avec valeur-p à un degré de liberté. Plus d’une strate peuvent être entrées pour supprimer tout doute.</p> ";
