T["PersonTime2--Comparing Two Person-Time Rates"]=
  "PersonTime2--Comparaison de deux taux Personne-Temps";
T["This module compares case rates in exposed and unexposed persons, using person time of exposure or non-exposure as denominators. Time can be entered as person-hours, -days, -years, etc., using the same units for exposed and unexposed persons. <p>Fisher and midP exact tests are included in the results. More than one stratum can be entered to calculate both crude and adjusted statistics.</p>"]=
  "Ce module compare les taux de cas de personnes exposées et non exposées, en utilisant le personne-temps d’exposition ou non comme dénominateur. Le temps peut être entré comme personne-heures, -jours, -ans, etc., en utilisant les mêmes unités pour les personnes exposées et non exposées. <p>Les tests exacts de Fisher et midP sont compris dans les résultats. Plus d’une strate peut être entrée pour calculer les statistiques brutes et ajustées.</p>";
