//C:/OpenEpi///C:/OpenEpi/SMR/SMR.htm  Sunday, August 05, 2007 9:15:09 PM
T["When you get a dramatic result in OpenEpi (or any program), take the time to repeat the analysis in another program. There are hundreds of other calculators in a link on the menu, or use SAS, SPSS, or Epi Info."]=
  "Quand vous obtenez un résultat étrange avec OpenEpi (ou autre programme), prenez le temps de répéter l'analyse avec un autre programme. Il y a des centaines d'autres calculateurs dans un lien du menu, ou utiliser SAS, SPSS ou Epi Info.";
T["If you would like to develop a program, check the developer's section of the menu, and also send us an email"]=
  "Si vous voulez développer un programme, consultez la section du développeur dans le menu et envoyez-nous un courriel";
T["More Exercises"]="Plus d’exercices";
T["Standardized Mortality Ratio "]="Rapport de mortalités standardisées ";
T["The Standardized Mortality Ratio (SMR) is the ratio of observed to the expected number of deaths in the study population under the assumption that the mortality rates for the study population are the same as those for the general population. For nonfatal conditions, the Standardized Mortality Ratio is sometimes known as the Standardized Morbidity Ratio. Entering observed and expected number of cases (deaths) will result in the point estimate of SMR and the confidence intervals at the user's setting. "]= 
  "Le rapport de mortalités standardisées (RMS) est le rapport du nombre de morts observés sur le nombre de morts anticipés dans une population d’étude sous l'hypothèse que les taux de mortalité pour la population d'étude sont les mêmes que ceux d'une population générale. Pour des conditions non mortelles, le rapport de mortalités standardisées est parfois connu comme le rapport de morbidités standardisées. En entrant le nombre de cas (morts) observés et le nombre de cas anticipés, le résultat sera l’estimation ponctuelle du RMS et les intervalles de confiance avec les paramètres de l'utilisateur. ";
T["Author(s) "]="Auteur(s) ";
T["Minn M. Soe and Kevin M. Sullivan, Emory University"]=
  "Minn M. Soe et Kevin M. Sullivan, Université d’Emory";
T["Interface"]="Interface";
T["Andrew G. Dean, EpiInformatics.com, and Roger A. Mir"]=
  "Andrew G. Dean, EpiInformatics.com, et Roger A. Mir";
T["No results yet. ENTER some data and choose CALCULATE."]=
  "Pas encore de résultats. ENTREZ des données et sélectionnez CALCULER.";
T["Demos and Exercises"]="Démonstrations et Exercices";
T["SMR--Demo"]="RMS--Démo";
T["In a rubber worker study, a group of 8418 white male workers ages 40-84 (either active or retired) on January 1, 1964, were followed for 10 years for various mortality outcomes. Their mortality rates were then compared with US while male mortality rates in 1968. In one of the reported findings, 4 observed deaths due to Hodjkin's disease were compared with 3.3 deaths expected from US cancer mortality rates. Is this difference significant? Evaluate the statistical significance of the results."]=
  "Dans une étude de travailleurs de caoutchouc, un groupe de 8418 travailleurs mâles blancs âgés de 40 à 84 ans (actifs ou retraités) au 1er janvier 1964 a été suivi pendant 10 ans pour des fins de mortalités diverses. Leur taux de mortalité était comparé avec ceux d’hommes blancs américains en 1968. Dans l’une des découvertes rapportées, 4 morts observées dues à la maladie d’Hodgkin ont été comparées avec 3,3 morts anticipées des taux de mortalité dû au cancer aux E-U. Cette différence est-elle significative ? Évaluez la signification statistique des résultats.";
T["To answer the question, enter the observed and expected numbers deaths in the respective data entry cells, and click on Calculate"]=
  "Pour répondre à cette question, entrez le nombre de morts observées et anticipées dans les cellules respectives d’entrée et cliquez sur Calculer";
T["In the new window screen, two-tailed p-value based on Exact method is 0.8393 with confidence intervals that include null value '1'. Therefore, the mortality rates are similar and there is no significant excess or deficit of Hodgkin's disease in this population."]=
  "Dans la nouvelle fenêtre, la valeur p bilatérale basée sur la méthode exacte est 0,8393 avec des intervalles de confiance qui comprennent les valeurs nulles '1'. En conséquence, les taux de mortalité sont similaires et il n’y a pas d’excès ou de défaut significatif de maladie d’Hodgkin dans cette population.";
T["Reference: Bernard Rosner. Fundamentals of Biostatistics(5th edition). (Data obtained from example 7.50; page 255)."]=
  " Référence: Bernard Rosner. Fondamentaux de Biostatistiques(5ème édition). (Données obtenues dans l’exemple 7.50; page 255).";
T["Not yet available"]="Pas encore disponible";

//C:/OpenEpi///C:/OpenEpi/Proportion/Proportion.htm  Sunday, August 05, 2007 9:15:23 PM
T["Numerator cannot be less than zero"]="Le numérateur ne peut pas être inférieur à zéro.";
T["Denominator cannot be less than zero"]="Le dénominateur ne peut pas être inférieur à zéro.";
T["Numerator cannot be larger than the denominator"]=
  "Le numérateur ne peut pas être supérieur au dénominateur";
T["<p>This module provides confidence limits for simple (binomial) proportions. Entering a numerator and denominator produces confidence limits calculated by several different methods. The numerator must be smaller than the denominator and both must be positive numbers.</p>"]=
  "<p>Ce module fournit les intevalles de confiance pour des proportions simples (binomiales). En entrant le numérateur et le dénominateur, cela donne les limites de confiance calculées par différentes méthodes. Le numérateur doit être inférieur au dénominateur et les deux doivent être des nombres positifs.</p>";
T["Confidence Limits for a Single Proportion "]=
  "Limites de confiance pour une proportion simple ";
T["This module provides confidence limits for simple (binomial) proportions. Entering a numerator and denominator produces confidence limits calculated by several different methods. The numerator must be smaller than the denominator and both must be positive numbers."]=
  "Ce module fournit les limites de confiance pour des proportions simples (binomiales). En entrant le numérateur et le dénominateur, cela donne les limites de confiance calculées par différentes méthodes. Le numérateur doit être inférieur au dénominateur et les deux doivent être des nombres positifs.";
T["Kevin M. Sullivan, Emory University"]=" Kevin M. Sullivan, Université d’Emory";
T["based on code from John C. Pezzullo"]="Basé sur le code de John C. Pezzullo";
T["Andrew G. Dean, EpiInformatics.com, and Roger Mir"]=
  " Andrew G. Dean, EpiInformatics.com, et Roger Mir ";
T["Proportion--Demo"]="Proportion--Démo";
T["A simple random or systematic sample survey in a state asked respondents, 'Have you ever been told by a doctor that you have diabetes?' Among 6153 respondents 418 answered 'yes' (excluding those with diabetes solely related to pregnancy). "]=
  "Une enquête simple d’échantillons aléatoires ou systématiques dans un état demandait aux personnes interrogées 'Un docteur vous a-t-il déjà dit que vous aviez le diabète ?' Parmi 6153 personnes interrogées, 418 ont répondu 'oui' (en excluant le diabète dû à une grossesse uniquement). ";
T["To find the percentage of respondents answering Yes, and 95% confidence limits, enter the numerator and denominator into the OpenEpi Proportion program and click Calculate."]=
  "Pour trouver le pourcentage de personnes interrogées qui ont répondu Oui avec des limites de confiance à 95%, entrez le numérateur et le dénominateur dans le programme OpenEpi Proportion et cliquez sur Calculer.";
T["The point estimate is 6.79% and the preferred (Wilson score) 95% confidence limits are 6.19% to 7.45%."]=
  "L’estimation ponctuelle est de 6,79% et les limites de confiance préférées à 95% (score de Wilson) sont de 6,19% à 7,45%.";
T["Pretend that the survey was smaller but found nearly the same percentage (42/616, or even 4/58)."]=
  "Prétendre que l’enquête était plus petite mais déterminer un pourcentage presque identique (42/616 ou même 4/58).";
T["Find the confidence intervals for these two proportions. "]=
  "Trouvez les intervalles de confiance pour ces deux proportions. ";
T["What does a smaller sample do to the confidence interval?"]=
  "Comment un échantillon plus petit agit sur l’intervalle de confiance ?";

//C:/OpenEpi///C:/OpenEpi/TwobyTwo/TwobyTwo.htm  Sunday, August 05, 2007 9:15:33 PM
T["TwobyTwo Tables "]="Tableaux 2 x 2 ";
T["Two by two tables are used to evaluate the association between a possible risk factor ('Exposure') and an outcome ('Disease'). Counts summarizing the occurence of the four possible combinations of events in the study population are entered into the appropriate cells. The table can be rotated or flipped so that either rows or columns represent Exposure, and the column headings (+) and (-) can be in either order to match common textbooks of epidemiology. A single table or multiple strata can be entered. "]=
  "Les tableaux 2 x 2 sont utilisés pour évaluer l’association entre un facteur de risque possible ('Exposition') et un résultat ('Maladie'). Les comptages résumant l'occurrence des quatre combinaisons possibles d’événements dans la population d’études sont entrés dans les cellules appropriées. Le tableau peut être tourné ou retourné de manière à ce que les lignes ou les colonnes représentent l'exposition et les en-têtes de colonnes (+) et (-) puissent être dans n'importe quel ordre pour correspondre aux manuels usuels d'épidémiologie. Un tableau simple ou à strates multiples peut être entré. ";
T["Statistics produced include the Fisher and mid-p exact tests, chi squares, odds ratio, maximum likelihood odds ratio estimate, risk/prevalence ratio (relative risk), risk difference, and etiologic fractions with confidence limits produced by several methods, with stratified analysis "]=
  "Les statistiques fournies comprennent les tests exacts de Fisher et mid-p, les tests du chi carré, les rapports de cotes, les estimations des rapports de cotes de maximum de vraisemblance, le rapport de risque/prévalence (risque relatif), différence de risque, et les fractions étiologiques avec limites de confiance données par plusieurs méthodes avec analyse stratifiée ";
T["and Andrew G. Dean, EpiInformatics.com"]="et Andrew G. Dean, EpiInformatics.com";
T["Exact and maximum likelihood statistics adapted from a Pascal program by David Martin. Thanks to Ray Simons for advice and testing."]=
  "Statistiques de maximum et d’exacte vraisemblance adaptées d’un programme en Pascal par David Martin. Merci à Ray Simons pour ses conseils et ses essais.";
T["Andrew G. Dean and Roger Mir"]="Andrew G. Dean et Roger Mir";
T["TwobyTwo--Demo"]="DeuxparDeux--Démo";
T["A cohort study of 162 men and 347 women examines the relationship between low income (the exposure) and a disease(say, osteoporosis, but these data are fictitious).To control for possible confounding by sex, men are entered in one stratum and women in the other.Choose Load Demo Data to see the data; then click on Calculate and choose Show all Results."]=
  "Une étude de cohorte de 162 hommes et 347 femmes examine la relation entre les bas-salaires (l’exposition) et une maladie(dite Ostéoporose, mais ces données sont fictives). Pour contrôler la possible confusion des sexes, les hommes sont entrés dans une strate et les femmes dans une autre. Choisissez Charger Données pour voir les données ; puis cliquez sur Calculer et choisissez Montrer tous les résultats.";
T["The chi square and midP exact results suggest that there is an association. The Risk Ratio(RR) adjusted across the strata is 1.16, a modest effect indeed(16% increase in risk), with confidence limits barely excluding 1.0. There is no evidence of interaction (difference in RR across strata). The adjusted and crude RRs and Odds Ratios are nearly identical, suggesting that there is no confounding by sex and that stratification is unnecessary."]=
  "Les résultats exacts de chi carré et de midP suggèrent qu'il y a une relation. Le Rapport de Risque (RR) ajusté à travers la strate est de 1,16, un effet modeste (16% d’augmentation du risque) avec des intervalles de confiance à peine excluant 1,0. Il n’y a pas de preuves d’interaction (différence du RR à travers les strates). Les RR et rapports de cotes ajustés et bruts sont presque identiques, suggérant qu’il n’y a pas de confusion des sexes et la stratification n'est pas nécessaire.";
T["Conclusion: The study shows little or no association between the exposure and the disease, and neither confounding nor interaction by sex are demonstrated. Alas, many studies turn out this way, but it is good to have the quantitative confirmation. 'Null hypothesis' is the winner."]=
  "Conclusion : L’étude montre peu ou pas d’association entre l’exposition et la maladie et ni confusion ni interaction entre les sexes ne sont démontrées. Hélas, de nombreuses études vont dans ce sens, mais il est bon d’avoir une confirmation quantitative. 'Hypothèse nulle' est la gagnante.";
T["Exercise 1--A Case-Control Study"]="Exercice 1--A Étude cas-témoins";
T["A case-control study examined Recent Oral Contraceptive use (OC) and Myocardial Infarction, with the following results:"]=
  "Une étude de cas-témoins étudiait l'utilisation des récents Contraceptifs oraux (CO) et les infarctus du myocarde donnant les résultats suivants :";
T["OC+,MI+ = 29 OC+,MI- = 135"]="CO+,IM+ = 29 CO+,IM- = 135";
T["OC-,MI+ = 205 OC-,MI- =1607"]="CO-,IM+ = 205 CO-,IM- =1607";
T["Analyze and interpret the data. What other information do you need and how would you analyze it?"]=
  "Analysez et interprétez ces données. De quelles autres informations avez-vous besoin et comment analyseriez-vous cela ?";
T["Reference: Schlesselman JJ, Case-Control Studies, Oxford, 1982; p. 187."]=
  "Référence: Schlesselman JJ, Études cas-témoins, Oxford, 1982; p. 187.";
T["Exercise 2--Attributable or Etiologic Fraction"]=
  "Exercice 2—Fraction étiologique ou attribuable";
T["HT +"]="HT +";
T["HT-"]="HT-";
T["MI+"]="IM+";
T["MI-"]="IM-";
T["Note that the table has Disease on the left and Exposure at the top. To avoid some serious mental gymnastics, choose Options/Setting in OpenEpi and select the Kleinbaum table layout. Then return to TwobyTwo and enter the data. Be sure to change the Setting back again if you normally work with Exposure on the left."]=
  "Remarquez que le tableau a Maladie sur la gauche et Exposition en haut. Pour éviter des efforts mentaux inconsidérés, choisissez Options/Paramètres dans OpenEpi et sélectionnez le tableau de Kleinbaum. Ensuite retournez au DeuxparDeux et entrez les données. Assurez-vous de changer le réglage de nouveau si vous travaillez normalement avec l'exposition sur la gauche.";
T["Hypothyroidism (HT) as a possible risk factor for myocardial infarction(MI) was studied in women over age 55 in Rotterdam."]=
  "L’hypothyroidie (HT) comme possible facteur d'infarctus du myocarde (IM) a été étudiée chez les femmes de plus de 55 ans à Rotterdam.";
T["What percentage of the MIs were attributable to HT? What percentage of MIs in those with HT? "]=
  "Quel pourcentage de IMs étaient attribuables à l'HT ? Quel pourcentage de IMs chez ceux avec HT ?";
T["lIs there a significant association between HT and MI in this study? "]=
  "Y-a-t-il une association significative entre HT et IM dans cette étude ?";
T["Data from Kleinbaum, Sullivan, Barker. ActivEpi Companion Textbook, Springer, NY, 2003, p. 150-1."]=
  "Données de Kleinbaum, Sullivan, Barker. ActivEpi Companion Textbook, Springer, NY, 2003, p. 150-1.";

//C:/OpenEpi///C:/OpenEpi/DoseResponse/DoseResponse.htm  Sunday, August 05, 2007 9:15:39 PM
T["Dose Response: Chi Square for Linear Trend "]=
  "Dose-Réponse : Test du Chi carré pour tendance linéaire ";
T["Use this module to test for trend when there are more than two levels of exposure. In the example shown, the levels are midpoints of ranges of cigarettes smoked per day during the third month of pregnancy. Cases are infants with congenital malformations. "]=
  "Utilisez ce module pour tester la tendance linéaire quand il y a plus de 2 niveaux d'exposition. Dans l'exemple montré, les niveaux sont les points centraux des plages de cigarettes fumées par jour pendant le troisième mois de grossesse. Les cas sont des bébés avec des malformations congénitales. ";
T["The test performed is the Extended Mantel Haenszel Chi Square for linear trend with a p-value for one degree of freedom. More than one stratum can be entered to remove confounding."]=
  "Le test effectué est le test étendu du Chi carré de Mantel Haenszel pour tendance linéaire avec valeur-p pour un degré de liberté. Plus d’une strate peuvent être entrées pour supprimer tout doute.";
T["Statistics and Interface"]="Statistiques et Interface";
T["Andrew G. Dean, EpiInformatics.com"]="Andrew G. Dean, EpiInformatics.com";
T["Equations from"]="Équations de";
T["Schlesselman, JJ. Case-Control Studies: Design, Conduct, Analysis. Oxford Univ. Press, NY, 1982; p.200-206."]=
  " Schlesselman, JJ. Études cas-témoins : Conception, Conduite, Analyse. Oxford Univ. Press, NY, 1982; p.200-206.";
T["DoseResponse--Demo"]="Dose-Réponse--Démo";
T["Use the Load Demo Data button to load data from a case-control study of myocardial infarction(MI) in women. There are five strata representing 5-year age groups from age 25 to 49 with Level 0 being non-smokers, Level 1 smoking 1-24 cigarettes per day, and Level 2 smoking 25 or more per day. After examining the strata, click Calculate to see the results. "]=
  "Utilisez le bouton Charger Données Démo pour charger les données de l'étude cas-témoins des Infarctus du myocarde (IM) chez les femmes. Il y a cinq strates représentant des groupes d’une plage de 5 ans de 25 à 49 ans avec niveau 0 pour non-fumeurs, Niveau 1 pour 1 à 24 cigarettes par jour, et niveau 2 pour plus de 25 cigarettes par jour. Après avoir examiné la strate, cliquez sur Calculer pour voir les résultats. ";
T["Age adjusted odds ratios are 1.0 for non-smokers (baseline group); 3.16 for Level 1 and 8.56 for Level 2 smokers. "]=
  "Les rapports de cotes ajustés des âges sont 1,0 pour les non-fumeurs (groupe de base) ; 3,16 pour les fumeurs de niveau 1 et 8,56 pour ceux de niveau 2. ";
T["The Mantel-Haenszel extended chi square summarizing linear trend is 128.8 with a p-value less than 0.0000001. "]=
  "Le test de chi carré étendu de Mantel-Haenszel résumant la tendance linéaire est de 128,8 avec une valeur p inférieure à 0,0000001. ";
T["We conclude that there is a dose-response of MIs by smoking level after adjusting for 5-year age group. Other factors have not yet been considered."]=
  "Nous concluons qu'il n'y a pas de dose-réponse des IMs par niveau de fumeurs après ajustement des groupes de 5 ans. Les autres facteurs n'ont pas encore été considérés.";
T["Data from Schlesselman JJ. Case-Control Studies, Oxford, 1982;p. 205. Note that the answers differ slightly due to the inclusion of a continuity correction in the OpenEpi formulas, following Rosner B Fundamentals of Biostatistics, 4th ed., Duxbury, 2000;p 607-9."]=
  "Données de Schlesselman JJ. Études cas-témoins, Oxford, 1982;p. 205. Remarquez que les réponses diffèrent légèrement suite à l'ajout d'une correction de continuité dans les formules de OpenEpi, suivant Rosner B Fondamentaux de Biostatistiques, 4ème éd., Duxbury, 2000;p 607-9.";
T["Age and Snoring"]="Âge et ronflement";
T["A questionnaire study of state employees in Wisconsin gave the following data: "]=
  "Une étude par questionnaire des employés de l’état du Wisconsin donnait les données suivantes : ";
T["Women"]="Femmes";
T["Men"]="Hommes";
T["Age"]="Âge";
T["Snore"]="Ronflement";
T["No_Snore"]="Pas de ronflement";
T["Does the frequency of snoring increase with age, after adjusting for sex?"]=
  "Est-ce que la fréquence de ronflement augmente avec l'âge, après ajustement par sexe ?";
T["Rosner B Fundamentals of Biostatistics, 4th ed., Duxbury, 2000; p. 606."]=
  "Rosner B Fondamentaux de Biostatistiques, 4ème éd., Duxbury, 2000; p. 606.";

//C:/OpenEpi///C:/OpenEpi/RbyC/RbyC.htm  Sunday, August 05, 2007 9:15:44 PM
T["R by C Table "]="Tableau R par C ";
T["Use this table to test for an association between variables with more than 2 values, for example 3 diseases and 3 blood types. The result is a chi square testing whether the results differ from those expected from the marginal sums alone. Further testing may be necessary to localize a significant finding, using either a subset in this table or the TwobyTwo statistics. "]=
  "Utilisez ce tableau pour tester une association entre les variables de plus de 2 valeurs, par exemple 3 maladies et 3 types sanguins. Le résultat est un test du chi carré évaluant si les résultats diffèrent de ceux anticipés des sommes marginales seules. Des tests additionnels peuvent être nécessaires pour trouver une découverte significative, en utilisant soit une sous-partie de ce tableau soit des statistiques deux par deux. ";
T["Criteria are evaluated to see if the chi square result can be accepted, as chi square is not reliable for small expected values. "]=
  "Les critères sont évalués pour voir si le résultat du test du chi carré peut être accepté, étant donné que le test du chi carré n’est pas fiable pour les petites valeurs attendues. ";
T["Andrew G. Dean and Kevin M. Sullivan"]="Andrew G. Dean et Kevin M. Sullivan";
T["RbyC--Demo"]="R par C--Démo";
T["Click 'Load Demo Data' for data from a study of blood type, peptic ulcer, gastric cancer, and a control group with neither disease "]=
  "Cliquez sur 'Charger les données de Démo' pour obtenir les données d’une étude de type sanguin, d’ulcère peptique, cancer gastrique et d’un groupe témoin sans aucune maladie ";
T["Click 'Calculate' to find the chi square and p value for 4 degrees of freedom."]=
  "Cliquez sur 'Calculer' pour trouver le chi carré et la valeur-p avec 4 degrés de liberté.";
T["P is very small, suggesting that an association between blood type and disease exists, but further work is needed to describe how the results differ from those expected by chance. "]=
  "P est très petit, suggérant qu’une association entre le type sanguin et la maladie existe, mais des travaux complémentaires sont nécessaires pour décrire pourquoi les résultats diffèrent de ceux attendus. ";
T["If percentages are not shown in the result table, they can be turned on in the Options/Settings choice of the menu. "]=
  "Si les pourcentages ne sont pas montrés dans le tableau de résultats, ils peuvent être activés dans Options/Paramètres du menu. ";
T["Data from Snedecor, GW & Cochran, WG Statistical Methods, Iowa State, Ames, Iowa, 1980, p. 210."]=
  "Données de Snedecor, GW & Cochran, Méthodes statistiques WG, Iowa State, Ames, Iowa, 1980, p. 210.";
T["Refine the results from the demo by running R by C from the Enter New Data button. Specify 2 rows and 2 columns so that you can compare blood type O versus other blood types (vertically) and Peptic Ulcer versus all others (horizontally). "]=
  "Affinez les résultats de la démo en exécutant R par C avec le bouton Entrer Nouvelles données. Spécifiez 2 lignes et 2 colonnes de façon à pouvoir comparer les types sanguins O et les autres types (verticalement) et les ulcères peptiques et les autres (horizontalement). ";
T["Rather than pulling out your calculator to combine values, enter 983 in the upper left for peptic ulcer, type O patients. Now click on the total for the first column, click Yes, and enter 1796. Note that the combined A+B cell for peptic ulcer is calculated. "]=
  "Plutôt que d’extraire les valeurs combinées de votre calculatrice, entrez 983 dans la partie supérieure gauche pour les patients avec ulcère peptique de type sanguin O. Maintenant cliquez sur le total de la première colonne, cliquez sur Oui et entrez 1796. Remarquez que la cellule combinée A+B pour les ulcères peptiques est calculée. ";
T["Use this feature to enter the total type O column as 4258. You will have to add 3720+788 manually and place the sum(4508) in the second row, last column. Now the total should be 8766."]=
  "Utilisez cette fonction pour entrer le total 4258 de la colonne de type O. Vous devrez ajouter 3720+788 manuellement et mettre la somme (4508) dans la seconde ligne, dernière colonne. Maintenant le total devrait être de 8766.";
T["You can label the margins by clicking in the marginal cells. "]=
  "Vous pouvez étiqueter les marges en cliquant sur les cellules marginales. ";
T["Click Calculate and find the chi square and tiny p value, indicating a relationship between blood type O and peptic ulcer. More information could be obtained by running the Two by Two program with the same numbers. "]=
  "Cliquez sur Calculer et obtenez le chi carré et la valeur-p simplifiée, qui indiquent une relation entre le type sanguin O et l’ulcère peptique. Plus d’informations pourront être obtenues en exécutant le programme deux par deux avec les mêmes nombres. ";

