  "Les paires de cas-témoins appariés 1:1 pour des caractéristiques définies sont évaluées pour l’exposition au facteur de risque et distribuées dans les quatre cellules du tableau qui représentent les quatre combinaisons possibles de résultats dans une paire. Les comptages représentent les PAIRES contenant 1 cas et 1 témoin plutôt que des cas individuels. ";
