  "Les résultats comprennent les tests exacts de Fisher et midP, les limites de confiance pour les rapports de cotes, le test de McNemar et les rapports de cotes des paires appariées pour évaluer si une association existe entre le statut des cas et la présence ou l’absence du facteur de risque.";
