T["To analyse this, enter the given values in respective cells in Open Epi ANOVA for comparing two or more means, and click on Calculate"]=
  "Pour analyser cela, entrez les valeurs données dans les cellules respectives de Open Epi ANOVA pour comparaison de deux ou plusieurs moyennes, et cliquez sur Calculer";
T["In the new window screen, p-value from "]="Dans la nouvelle fenêtre, la valeur-p du  ";
